import useFetch from './service/service';
import './App.css';


function App() {
  const {data, loading, error} = useFetch(`http://localhost:3000/user/${data.data.id}`)
  // const userId = data.data.id

  if(loading) return <h1>LOADING ...</h1>
  if(error) console.log(error);

  return (
    <div className="App">
        <button>User
          {data?.data.id}
        </button>
    </div>
  );
}

export default App;
